var fileJSON=[{"path":"/home/ania/git_tile_v1/gridding_kernels_tile.cl", "name":"gridding_kernels_tile.cl", "has_active_debug_locs":true, "absName":"/home/ania/git_tile_v1/gridding_kernels_tile.cl", "content":"\012\012__attribute__((max_global_work_dim(0)))\012__kernel void oskar_process_all_tiles(\012       int num_w_planes,\012       __global const int* restrict support,\012       int oversample, \012       __global const int* restrict compact_wkernel_start, \012       __global const float2* restrict compact_wkernel,\012       float cell_size_rad,\012       float w_scale,\012       int trimmed_grid_size,\012       int grid_size,\012       int boxTop_u, int boxTop_v,\012       int tileWidth, //\012       int tileHeight,\012       int numTiles_u, int numTiles_v,\012       __global const int* restrict numPointsInTiles,\012       __global const int* restrict offsetsPointsInTiles,\012       __global float* restrict bucket_uu,\012       __global float* restrict bucket_vv,\012       __global float* restrict bucket_ww,\012       __global float2* restrict bucket_vis,\012       __global int * restrict workQueue_pu, \012       __global int * restrict workQueue_pv,\012       __global float* restrict grid\012       )\012{\012#if 1\012  const int g_centre = grid_size / 2;\012  const double scale = grid_size * cell_size_rad;\012\012  const int nTiles = numTiles_u * numTiles_v;\012\012  double norm = 0.0;\012  int num_skipped = 0;\012\012#define NUM_POINTS_IN_TILES(uu, vv)  numPointsInTiles[( (uu) + (vv)*numTiles_u)]\012#define OFFSETS_IN_TILES(uu, vv)     offsetsPointsInTiles[( (uu) + (vv)*numTiles_u)]\012\012#define MAX( A, B ) ( (A) > (B) ? (A) : (B) )\012#define MIN( A, B ) ( (A) < (B) ? (A) : (B) )\012\012\012#define MAX_TILE_WIDTH 64\012#define MAX_TILE_HEIGHT 64\012\012float2 grid_local[MAX_TILE_WIDTH][MAX_TILE_HEIGHT];\012\012  // Loop over the Tiles.\012#pragma omp parallel for default(shared) reduction(+:local_norm) schedule(static, 1)\012  for (int tile=0; tile<nTiles; tile++)\012    {\012		// Get some information about this Tile.\012		int pu = workQueue_pu[tile];\012		int pv = workQueue_pv[tile];\012\012        int tileTopLeft_u = pu*tileWidth;\012        int tileTopLeft_v = pv*tileHeight;\012        int tileOffset = tileTopLeft_v*trimmed_grid_size + tileTopLeft_u;\012        //printf(\"pu: %d, pv: %d, tileOffset: %d\\n\", pu, pv, tileOffset);\012        __global float2 *restrict grid_pointer;\012        grid_pointer = (__global float2 *restrict)grid;\012        for (int y=0; y<tileHeight; y++){\012            for (int x=0; x<tileWidth; x++){\012                grid_pointer = (__global float2 *restrict)&grid[(tileOffset + y*trimmed_grid_size + x)*2];\012                grid_local[y][x] = *grid_pointer;\012            }\012        }\012\012		const int off = OFFSETS_IN_TILES(pu, pv);\012		const int num_tile_vis = NUM_POINTS_IN_TILES(pu,pv);\012\012		// Loop over visibilities in the Tile.\012		for (int i = 0; i < num_tile_vis; i++)\012		{\012			// Convert UV coordinates to grid coordinates.\012			float pos_u    = -bucket_uu[off+i] * scale;\012			float pos_v    = bucket_vv[off+i] * scale;\012			float ww_i     = bucket_ww[off+i];\012			//const float w  = bucket_weight[off+i];\012			const float w  = 1.0;\012			float2 val     = bucket_vis[off+i];\012			val.x *= w;\012			val.y *= w;\012\012			const int grid_u = (int)round(pos_u) + g_centre - boxTop_u;\012			const int grid_v = (int)round(pos_v) + g_centre - boxTop_v;\012			const int grid_local_u = grid_u - tileTopLeft_u;\012            const int grid_local_v = grid_v - tileTopLeft_v;\012			int grid_w = (int)round(sqrt(fabs(ww_i * w_scale)));\012			if(grid_w >= num_w_planes) grid_w = num_w_planes - 1;\012\012			const int wsupport = support[grid_w];\012/*\012			if (grid_u + wsupport >= trimmed_grid_size || grid_u - wsupport < 0 ||\012					grid_v + wsupport >= trimmed_grid_size || grid_v - wsupport < 0)\012			{\012				num_skipped += 1;\012				continue; //TODO: Is this the best way to break the rest of loop?\012			}        \012*/\012			// Scaled distance from nearest grid point.\012			const int off_u = (int)round( (round(pos_u)-pos_u) * oversample);   // \\in [-oversample/2, oversample/2]\012			const int off_v = (int)round( (round(pos_v)-pos_v) * oversample);    // \\in [-oversample/2, oversample/2]\012\012			// Convolve this point.\012			double sum = 0.0;\012\012			const int compact_start = compact_wkernel_start[grid_w];\012\012			float conv_mul = (ww_i > 0 ? -1.0f : 1.0f);\012			// Now need to clamp iteration range to this tile.  Tile is \012			//          boxTop_u + pu*tileWidth, boxTop_v + (pu+1)*tileWidth - 1\012			// and the same for pv.  Our grid iteration range is\012			//       grid_u + k\012			// for -wsupport <= k <= wsupport and \012			//       grid_v + j\012			// for -wsupport <= j <= wsupport\012\012			const int tile_u[] = {pu*tileWidth, (pu+1)*tileWidth-1};\012			const int tile_v[] = {pv*tileHeight, (pv+1)*tileHeight-1};\012\012			const int kstart = MAX(tile_u[0]-grid_u, -wsupport);\012			const int kend   = MIN(tile_u[1]-grid_u,  wsupport);\012\012			const int jstart = MAX(tile_v[0]-grid_v, -wsupport);\012			const int jend   = MIN(tile_v[1]-grid_v,  wsupport);\012\012			int u_fac = 0, v_fac = 0;\012			if (off_u >= 0) u_fac = 1;\012			if (off_u < 0) u_fac = -1;\012			if (off_v >= 0) v_fac = 1;\012			if (off_v < 0) v_fac = -1;\012        \012			for (int j = jstart; j <= jend; ++j)\012			{\012				  // Compiler assumes there's a dependency but there isn't\012				  // as threads don't access overlapping grid regions.\012				  // So we have to tell the compiler explicitly to vectorise.\012				#pragma omp simd\012				for (int k = kstart; k <= kend; ++k)\012				{\012					int p = compact_start + abs(off_v)*(oversample/2 + 1)*(2*wsupport + 1)*(2*wsupport + 1)  + abs(off_u)*(2*wsupport + 1)*(2*wsupport + 1)  + (j*v_fac + wsupport)*(2*wsupport + 1) + k*u_fac + wsupport;\012\012					float2 c = compact_wkernel[p];\012					c.y *= conv_mul;\012\012					// Real part only.\012					sum += c.x;\012\012					//p = ((grid_v + j) * trimmed_grid_size) + grid_u + k;\012					//grid[2*p]     += (val.x * c.x - val.y * c.y);\012					//grid[2*p + 1] += (val.y * c.x + val.x * c.y);\012                    grid_local[grid_local_v + j][grid_local_u + k] +=\012                        (float2) ((val.x * c.x - val.y * c.y), (val.y * c.x + val.x * c.y));\012				}\012			}\012			norm += sum * w;\012\012            \012		} // END loop over vis in tile\012\012        // put the grid back\012        for (int y=0; y<tileHeight; y++){\012            for (int x=0; x<tileWidth; x++){\012                grid_pointer = (__global float2 *restrict)&grid[(tileOffset + y*trimmed_grid_size + x)*2];\012                *grid_pointer = grid_local[y][x];\012            }\012        }\012     \012\012    } // END loop over tiles\012\012  /*auto stop = std::chrono::high_resolution_clock::now();\012  std::chrono::duration<double> diff = stop-start;\012  printf(\"Tile processing time: %gms\\n\", diff.count()*1000);\012  */\012\012#undef NUM_POINTS_IN_TILES\012#undef OFFSETS_IN_TILES\012\012#endif\012}\012\012"}];